import "./styles.css";
import MainPageHeader from "./my-image/MainPageHeader.png";

function importALL(relativeLink) {
  let image = {};
  relativeLink.keys().map((item, index) => { images[item.replace('./', '')] = relativeLink(item); });
  return images;
}

const images = importALL(require.context('./my-image', false, /\.(png|jpe?g|svg)$/));


export default function Footer() {
  return (
    <footer>
      <br />
      <hr />
      <p>
        Powered by Rose
        <br />
        Email:
        <a href="mailto:dululusang@outlook.com">dululusang@outlook.com</a>
      </p>
    </footer>
  );
}
